import { Component, OnInit } from '@angular/core';
import { Prospecto } from '../../Classes/Prospecto';

@Component({
  selector: 'app-home',
  templateUrl: './captura.component.html',
})
export class CapturaComponent implements OnInit {
  prospectoModel = new Prospecto("", "", "", "", "", "", 0, "", "", undefined, "");

  constructor() { }

  ngOnInit() { }

  onSubmit() {

  }
}
<h1>Captura del prospecto</h1>

<form #formularioMascota="ngForm" (ngSubmit)="onSubmit()">
  <input type="text" name="nombre" placeholder="Nombre del prospecto" [(ngModel)]="prospectoModel.nombre">
  <br><br>
  <input type="text" name="raza" placeholder="Raza de mascota" [(ngModel)]="prospectoModel.raza">
  <br><br>
  <input type="number" name="edad" placeholder="Edad de mascota" [(ngModel)]="prospectoModel.edad">
  <br><br>
  <button type="submit">Guardar</button>
</form>

<h2>Depurando prospecto:</h2>
{{ prospectoModel | json }}
